import React from 'react';
import './Header.css';
import logoSoT from '/img/logo_SoT.png';
import logoLY from '/img/logo_LY.svg';

function Header() {
  return (
    <header className="header">
      <div className="triangle-container"> {/* Added class for the triangle */}
        <img src={logoSoT} alt="Ship of Thesis Logo" className="triangle-logo" />
      </div>
      <div className="header-logo rectangle-container">
        <img src={logoLY} alt="Linssen Yachts Logo" />
      </div>
    </header>
  );
}

export default Header;
